import React, { useState } from "react";

const Dashboard = () => {
  const [showModal, setShowModal] = useState(false);
  const [modalTitle, setModalTitle] = useState("");
  const [formData, setFormData] = useState({
    subject: "",
    content: "",
    mobileNumber: "",
    language: "",
  });

  // Open modal
  const openModal = (title) => {
    setModalTitle(title);
    setShowModal(true);
  };

  // Close modal
  const closeModal = () => {
    setShowModal(false);
    setFormData({ subject: "", content: "", mobileNumber: "", language: "" });
  };

  // Handle input change
  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Submitted Data:", formData);
    alert(`${modalTitle} Submitted Successfully!`);
    closeModal();
  };

  return (
    <div className="container mt-5">
      <h2 className="mb-4">Dashboard</h2>
      <div className="d-flex gap-3">
        <button className="btn btn-primary" onClick={() => openModal("Add Notification")}>
          Add Notification
        </button>
        <button className="btn btn-success" onClick={() => openModal("Add Notice")}>
          Add Notice
        </button>
      </div>

      {/* Modal */}
      {showModal && (
        <div className="modal fade show d-block" tabIndex="-1">
          <div className="modal-dialog">
            <div className="modal-content">
              <div className="modal-header">
                <h5 className="modal-title">{modalTitle}</h5>
                <button type="button" className="btn-close" onClick={closeModal}></button>
              </div>
              <div className="modal-body">
                <form onSubmit={handleSubmit}>
                  <div className="mb-3">
                    <label className="form-label">Subject</label>
                    <input
                      type="text"
                      className="form-control"
                      name="subject"
                      value={formData.subject}
                      onChange={handleChange}
                      required
                    />
                  </div>
                  <div className="mb-3">
                    <label className="form-label">Content</label>
                    <textarea
                      className="form-control"
                      name="content"
                      rows="3"
                      value={formData.content}
                      onChange={handleChange}
                      required
                    ></textarea>
                  </div>
                  <div className="mb-3">
                    <label className="form-label">Mobile Number</label>
                    <input
                      type="text"
                      className="form-control"
                      name="mobileNumber"
                      value={formData.mobileNumber}
                      onChange={handleChange}
                      required
                    />
                  </div>
                  <div className="mb-3">
                    <label className="form-label">Language</label>
                    <input
                      type="text"
                      className="form-control"
                      name="language"
                      value={formData.language}
                      onChange={handleChange}
                      required
                    />
                  </div>
                  <div className="d-flex justify-content-end">
                    <button type="button" className="btn btn-secondary" onClick={closeModal}>
                      Close
                    </button>
                    <button type="submit" className="btn btn-primary ms-2">
                      Submit
                    </button>
                  </div>
                </form>
              </div>
            </div>
          </div>
        </div>
      )}

      {/* Backdrop for Modal */}
      {showModal && <div className="modal-backdrop fade show"></div>}
    </div>
  );
};

export default Dashboard;
